import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import User from "./components/User";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/api/register" />
        </Routes>
        <User />
      </Router>
    </div>
  );
}

export default App;
